import React from 'react'
import styles from './index.less'

export default class Header extends React.Component {
  render() {
    return (
      <>
        <header>
          <div className="w header-content">
            <img src="/static/img/logo.png" alt=""/>
          </div>
        </header>
        <style jsx>
          {
            styles
          }
        </style>
      </>
    )
  }
}
